def generate_primes(n):
    primes = list()
    for num in range(3, n + 1):
        is_prime = True
        i = 2
        while i * i <= num:
            if num % i:
                i += 1
            else:
                is_prime = False
                break
        if is_prime:
            primes.append(num)
    return primes

